import React from 'react';

const Carousel = () => {
  return (
    <div className="supercontainer">
      <div className="container-carousel">
        <div className="carruseles" id="slider">
          {/* Aquí puedes mapear las imágenes del carrusel */}
          <section className="slider-section">
            <img src="SKINS/arma11.png" alt="Image 1" width="450" height="450" />
          </section>
          {/* Repite para más imágenes */}
        </div>
        <div className="btn-left" onClick={moveToLeft}>←</div>
        <div className="btn-right" onClick={moveToRight}>→</div>
      </div>
    </div>
  );
};

export default Carousel;
